function App() {
  let arr = [
    {date: new Date(2022,11,24),title: "Car Insurance",price:2000},
    {date: new Date(2021,2,2),title: "Netfilx Subscription",price:599}
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      {
        arr.forEach(element => {
          <ExpenseItem title={Element.title} date ={arr[0].date} price={arr[0].price}></ExpenseItem>
        })
      }



    </div>
  );
}

export default App;
